from LowLevelDesign.VendingMachine.states.state import Stateclass ProductDispense(State):    def __init__(self):        super().__init__()    def dispense_product(self, product_details):        from LowLevelDesign.VendingMachine.states.idle_state import IdleState        self.inventory.dispense_product(product_details)        next_state = IdleState()        self.change_state(next_state)